description:
Kaito left his hometown with a dream to be a big man. But he doesn't have any clear ideas, so he just lazily lives every day. It's no good. Kaito decides to work at a newly opened resort facility called &quot;A LO HA&quot;. But he meets various girls he had relationships before there...

